import React from "react";
import "./Activity.scss";
import trauma from "./src/assets/img/the.svg";

const Activity = () => {
    return (
        <div className="activity">
            <h1 className="activity-h1">
                Сфери діяльності Асоціації
            </h1>
            <div className="container align-self-auto justify-content-between">
                <img src="./src/assets/img/the.svg" className="rounded float-left" alt=""/>
                {/*<img src=".src/assets/img/family.png" className="rounded float-none"/>*/}
                <img src=".src/assets/img/child.png" className="rounded float-right"/>

            </div>
        </div>
    )
};

export default Activity;
